import React from 'react';
import './skills.css';

const Skills = () => {
  return (
    <section id='skills'>
        <span className="skillTitle">What I do</span>
        <span className="skillDesc">I am a Student and Currently working on web development</span>
    </section>
  )
}

export default Skills;
